import React from "react";
import "./App.css";
import Food from "./Components/food";
import Nav from "./Components/Nav/Nav"
import Foot from "./Components/foot";
import SingIn from "./Components/SingIn";
import Commande from "./Components/Commande";

function App() {
  return (
    <div className="App">
      <Nav />
      <Commande />
      <Foot />
      </div>
  );
}

export default App;
